import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import StateSelection from './components/StateSelection';
import CourtOption from './components/CourtOptions';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourt';
import UploadJudgment from './components/UploadJudgment';
import ViewJudgment from './components/ViewJudgment';
import NavBar from './components/NavBar';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/state-selection" element={<StateSelection />} />
        <Route path="/court-options/:state" element={<CourtOption />} />
        <Route path="/district/:state" element={<DistrictCourtPage />} />
        <Route path="/high/:state" element={<HighCourtPage />} />
        <Route path="/view-judgment/:courtType/:state" element={<ViewJudgment />} />
        <Route path="/upload-judgment/:courtType/:state" element={<UploadJudgment />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
